import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Observable } from 'rxjs';
import { FoodService } from 'src/app/services/food.service';
import { Food } from 'src/app/shared/models/Food';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  foods: Food[] = [];
  constructor(private foodService: FoodService, activatedRoute: ActivatedRoute) {
    let foodsObservalbe:Observable<Food[]>;
    activatedRoute.params.subscribe((params) => {
      if (params.searchTerm)
        foodsObservalbe = this.foodService.getAllFoodsBySearchTerm(params.searchTerm);
      else if (params.tag)
        foodsObservalbe = this.foodService.getAllFoodsByTag(params.tag);
      else
        foodsObservalbe = foodService.getAll();

        foodsObservalbe.subscribe((serverFoods) => {
          this.foods = serverFoods;
        })
    })
  }

  ngOnInit(): void {
  }

}
<app-header></app-header>
<app-search-bar></app-search-bar>
<app-category-list></app-category-list>
<app-empty-state *ngIf="!foods || !foods.length" message="No items found" buttonText="Go Back"></app-empty-state>
<section class="food-list">
  <div class="food-card" *ngFor="let food of foods" routerLink="/food/{{food.id}}">
    <div class="food-image">
      <img [src]="food.imageUrl" [alt]="food.name" />
    </div>
    <div class="food-details">
      <h3 class="food-name">{{food.name}}</h3>
      <span class="favorite-icon {{food.favorite ? 'active' : ''}}">❤️</span>
      <div class="rating"><star-rating [stars]="food.stars"></star-rating></div>
      <div class="meta-info">
        <div class="origin-tags">
          <span class="tag" *ngFor="let origin of food.origins">{{origin}}</span>
        </div>
        <div class="cook-time">
          ⏱ {{food.cookTime}}
        </div>
      </div>
      <div class="food-price">
        {{food.price | currency}}
      </div>
    </div>
  </div>
</section>
